@font-face {
  font-family: GT Walsheim Pro;
  src: local("GT Walsheim Pro Regular"), local("GTWalsheimProRegular"),
    url(/static/fonts/GTWalsheimProRegular.woff2) format("woff2"),
    url(/static/fonts/GTWalsheimProRegular.woff) format("woff"),
    url(/static/fonts/GTWalsheimProRegular.ttf) format("truetype");
  font-weight: 400;
  font-style: normal;
}

:root {
  --black: black;
  --white: white;
  --highlight: #f8ea4a;
}
html {
  font-family: GT Walsheim Pro;
  box-sizing: border-box;
  height: 100%;
}
*,
*::before,
*::after {
  box-sizing: inherit;
}
body {
  padding: 0;
  margin: 0;
}
.flexRow {
  display: flex;
  flex-direction: row;
}
.flexRowColumn {
  display: flex;
  flex-direction: column;
}

.formBtn,
[type="text"],
[type="email"] {
  border: none;
  border-style: none;
  width: 100%;
  height: 4rem;
  font-weight: 600;
  margin-top: 1rem;
}
[type="text"],
[type="email"] {
  border: 2px;
  border-style: solid;
  padding-top: 1.5rem;
  padding-left: 0.5rem;
  padding-bottom: 1rem;
}

.btn-success {
  background-color: var(--highlight);
}
.btn-clear {
  background-color: var(--black);
  color: var(--white);
}

.persvassivehook {
  display: grid;
  grid-template-columns: 1fr;
  grid-template-rows: 4rem 4rem 4rem;
  text-align: center;
  margin-bottom: 2rem;
  text-transform: capitalize;
}
.persvassivehook > p {
  margin-right: 0.8ex;
  font-size: 2rem;
  font-weight: 800;
  text-transform: capitalize;
}
.persvassivehook > p:first-child {
  grid-row: 1;
  grid-column: 1;
}
.persvassivehook > div {
  display: flex;
  flex-direction: row;
  width: 100%;
  justify-content: center;
  grid-row: 2;
  grid-column: 1;
}
.persvassivehook > div > p {
  margin-right: 0.8ex;
  font-size: 2rem;
  font-weight: 800;
  text-transform: capitalize;
}
.persvassivehook > p:nth-child(4) {
  grid-row: 3;
  grid-column: 1;
}
.formmodalbackground {
  position: fixed;
  top: 0;
  left: 0;
  height: 100%;
  width: 100%;
  background-color: gray;
  opacity: 0.985;
  z-index: 49;
}

.formmodal {
  position: fixed;
  top: 50%;
  left: 50%;
  max-height: 100vh;
  overflow: scroll;
  transform: translate(-50%, -30%);
  background-color: white;
  z-index: 50;
  padding: 2rem;
  width: 22vw;
  border: black;
  border-width: 1px;
  border-style: solid;
}
@media screen and (max-width: 1700px) {
  .formmodal {
    width: 25vw;
  }
}
@media screen and (max-width: 1500px) {
  .formmodal {
    width: 30vw;
  }
}
@media screen and (max-width: 1300px) {
  .formmodal {
    width: 40vw;
  }
}
@media screen and (max-width: 900px) {
  .formmodal {
    width: 55vw;
  }
}
